	public static void Main()
	{
		var readings = input.Split(new string[] { "\r\n" }, StringSplitOptions.None);
		
		int ogr = getRating(readings, "ogr");
		int csr = getRating(readings, "csr"); 
		
		Console.WriteLine(ogr * csr);	
	}
	
	public static int getRating(string[] readings, string ratingType) 
	{
		var bitLength = readings[0].Length;
		var bitPrefix = "";
		
		for (int i = 0; i < bitLength; i++) 
		{
			var bitCount = getBitCount(readings, i); 
			switch (ratingType[0]) 
			{
				case 'o':
					var mostCommon = (bitCount >= 0) ? "1" : "0"; 
					bitPrefix = bitPrefix + mostCommon;
					break;
				default :			
					var leastCommon = (bitCount < 0) ? "1" : "0"; 
					bitPrefix = bitPrefix + leastCommon;
					break;
			}	
			
			var readingsLeft = readings.Where(r => r.StartsWith(bitPrefix));
			if (readingsLeft.Count() == 1)
			{
				return Convert.ToInt32(readingsLeft.First(), 2);
			}
			
			readings = readingsLeft.ToArray();
		}
		
		return 0;
	}
	
	public static int getBitCount(string[] readings, int index) 
	{
		int bitCount = 0;
		for (int i = 0; i < readings.Length; i++) 
		{
			switch (readings[i][index]) 
			{
				case '1':
					bitCount +=1;
					break;	
				default :
					bitCount -=1;
					break;
			}	
		}
		
		return bitCount;
	}

